import Pokemon from './Pokemon';

const POKEMONS: Pokemon[] = [
  { id: 1, name: 'Pikachu', type: 'Electric', level: 5 },
  { id: 2, name: 'Bulbasaur', type: 'Grass', level: 7 },
  { id: 3, name: 'Charmander', type: 'Fire', level: 6 }
];

export default POKEMONS;
